import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import logo from "../Images/logo.png";
import SideBar from "./SideBar";



const Navbar = () =>{
  let [isSideBar, setIsSideBar] = useState(false);

  const showSide = ()=>{
    setIsSideBar(!isSideBar)
  }

  const scrollToTop = () => {
    window.scrollTo(0, 0); // Scroll to the top of the page
  };

  


    return(
        <nav className="navbar navbar-expand-lg">
  <div className="container">
    <NavLink className="navbar-brand" to="/">
        <img src={logo} alt="logo" title="logo" />
    </NavLink>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation" style={{ backgroundColor: "white" }}>
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div className="navbar-nav ms-auto">
        <NavLink to="/"  className="element"  aria-current="page" onClick={scrollToTop}>Home</NavLink>

        <NavLink  to="/about" className="element" onClick={scrollToTop}>About Us</NavLink>

        <NavLink  to="/product"  className="element" onClick={scrollToTop}>Products</NavLink>

        <NavLink  to="/crop"  className="element" onClick={scrollToTop}>Crops</NavLink>

        <NavLink  to="/certificate"  className="element" onClick={scrollToTop}>Certification</NavLink>

        <NavLink  to="/career"  className="element" onClick={scrollToTop}>Career</NavLink>

        <NavLink  to="/contact"  className="element" onClick={scrollToTop}>Contact Us</NavLink>

        <NavLink  to="" onClick={showSide}>
        
        <svg xmlns="http://www.w3.org/2000/svg" width="25" height="20" viewBox="0 0 25 24" fill="none">
            <path d="M2 2H34" stroke="#CA9523" strokeWidth="3" strokeLinecap="round"/>
            <path d="M2 12H34" stroke="#CA9523" strokeWidth="3" strokeLinecap="round"/>
            <path d="M2 22H34" stroke="#CA9523" strokeWidth="3" strokeLinecap="round"/>
        </svg>

        </NavLink>
        {isSideBar && <SideBar/>}

        
      </div>
    </div>
  </div>
</nav>
    )
}

export default Navbar;
